<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <title>Document</title>
  <style type="text/css">
    body { margin: 0; padding: 0;}

    #c {
      zoom: 80%;
    }

    @keyframes twinkle {
      0% { opacity: 1; }
      50% { opacity: .4; }
      100% { opacity: 1; }
    }

    @keyframes sail {
      from { transform: translate(-200px, 635px) rotate(-5deg);;}
      10% { transform: translate(150px, 635px) rotate(5deg); }
      20% { transform: translate(500px, 650px) rotate(-5deg); }
      30% { transform: translate(850px, 635px) rotate(5deg); }
      40% { transform: translate(1200px, 650px) rotate(-5deg); }
      49% {transform: translate(1600px, 635px) rotate(5deg); }
      50% { transform: translate(1600px, 650px) rotate(-5deg) scale(-1,1);}
      60% { transform: translate(1200px, 635px) rotate(5deg) scale(-1,1);}
      70% { transform: translate(850px, 650px) rotate(-5deg) scale(-1,1);}
      80% { transform: translate(500px, 645px) rotate(2deg) scale(-1,1);}
      90% { transform: translate(150px, 650px) rotate(-2deg) scale(-1,1);}
      99% { transform: translate(-200px, 635px) scale(-1,1);}
      to { transform: translate(-200px, 635px) scale(1,1);}
    }

    @keyframes bob {
      from { transform: rotate(0deg);}
      50% { transform: rotate(-2deg) translateY(10px); }
      to { transform: rotate(0deg); }
    }

    #Star:nth-child(3n) {
      animation: twinkle 1.5s ease infinite;
    }

    #Star:nth-child(2n) {
      animation: twinkle 1.5s ease infinite;
      animation-delay: -.75s;
    }

    #Sailboat {
      animation: sail 55s linear infinite;
    }

    #Sea-1, #Sea-2, #Sea-3 {
      animation: bob 7s linear infinite;
    }

    #Sea-1 {
      animation-duration: 20s;
    }

    #Sea-2 {
      animation-delay: -3s;
    }

    #Sea-3 {
      animation-duration: 10s;
      animation-delay: -5s;
    }
  </style>
